import './App.css';
import Homepage from './pages/homepage/homepage.component';
import {Route, Routes, BrowserRouter, useParams} from 'react-router-dom'

function Home(){
  return <h1>Homepage</h1>;
}

function Hat(prop){
  const {hat} = useParams();
  console.log(hat);
}
function Title(prop){
  console.log(prop);
  return null;
}

function App() {
  return (
    <div>
    {/* <Homepage /> */}
    <BrowserRouter>
    <Routes>
    <Route path="/" element={<Home/>}/>
    <Route path="/hat" element={<Hat/>}/>
    <Route path="select/:title" element={<Title/>}/>    
    </Routes>
    </BrowserRouter>
    </div>
  )
}

export default App;
